import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const fname = "Harshit";
const lname = "Garg";
const num = 5;
const img1 = "https://picsum.photos/200/300";
const img2 = "https://picsum.photos/300/400";
const img3 = "https://picsum.photos/400/500";
const link = "https://picsum.photos/";
const date = new Date().toLocaleDateString();
const time = new Date().toLocaleTimeString();
// .head {
//   color: royalblue;
//   text-align: center;
//   text-transform: capitalize;
//   font-weight: bold;
//   text-shadow: 0px 2px 4px black;
//   margin: 70px 0;
//   font-family: 'Redressed', cursive;
// }
const head = {
  textTransform: 'capitalize',
  color: 'royalblue',
  fontWeight: 'bold',
  textAlign: 'center',
  textShadow: '0px 2px 4px black'
}
ReactDOM.render(
  <>
    <h1
      style={head}
    > 
      {
        `my full name is ${fname} ${lname}`
      }
    </h1>
    <div className="img_div">
      <img src={img1} alt="images" />
      <img src={img2} alt="images" />
      <a href={link} target="_blank">
        <img src={img3} alt="images" /></a>
    </div>
  </>,
  document.getElementById('root'));
